import React, { useEffect, useState } from 'react';
import axios from 'axios';
import CountUp from 'react-countup';

const WorldWide = () => {

    const getCovidData = async () => {
        try {
            const res = await axios.get("https://api.covid19india.org/data.json").json();

            console.log(res);
        } catch (error) {
            console.log(error)
        }
    }

    useEffect(() => {
        getCovidData();
    }, [])

    return (<>
        <div className="container-fluid pt-lg-5 pt-3">
            <h1 className="font-weight-light text-center">Covid19 Cases Across The India</h1>
        </div>
    </>)
}

export default WorldWide;
